WIN! The rumours are true. Christmas has come early with the opening of iconic Melbourne footwear brand Bared launching their flagship store in Pac Fair this weekend. To celebrate, we’re giving 5 people the chance to win a pair of shoes for you and your Bestie. Simply
1. Tag them in the comments
2. Both Follow https://www.instagram.com/baredfootwear/ + https://www.instagram.com/pacificfair/
Comp closes Sunday 15 Dec, winners announced Monday 16 Dec. T&C’s apply.

