We're all about those bohemian vibes. So we teamed up with our mates at @partywithlenzo to forge the ultimate boho-styled wedding! 👰🏼 Our favourite Cormorant, Paradise, Rhea and Diver heels made an appearance, along with @baredfootwearmens Sodium brogues. We're mesmerised by how beautifully Kristy, from @figtreepictures, captured this magical day. ✨ Get inspired, and tag a bride to be! 🌸 .

